import React from 'react'

export default function BottomBar(props)
{
    return(
        <div id="footer">
            <ol id="social-container">
                {
                    Object.keys(props.social).map(site => {
                        return(
                            <li key={site} className="social-link"><a href={props.social[site]}>{site}</a></li>
                        )
                    })
                }
            </ol>
        </div>
    )
}
